import React from 'react';
import styles from '../styles.css'

export default class NavBar extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            onPage: true,
        }
    }

    componentDidMount() {
        console.log("Hello World!")
    }

    render() {
        return(
            <div class="NavBar">
                <table>
                    <tbody>
                        <tr>
                            <td class="NavTab">
                                <p>Home</p>
                            </td>
                            <td class="NavTab">
                                <p>Portfolio</p>
                            </td>
                            <td class="NavTab">
                                <p>About</p>
                            </td>
                        </tr>
                    </tbody>
                </table>
            </div>
        );
    }
}
